import React from 'react';
import style from 'styled-components';
import Landing from './page/Landing';
import './App.css';

const Wrapper = style.div`

  background-color: #232323;
  height: 100vh;
  width: 100vw;

`;

function App() {
  return (
      <Wrapper>
        <Landing/>
      </Wrapper>
  );
}

export default App;
